import React from "react";
import logo from '../asset/img/Alogo.png';
import "../asset/style/Log_in.css";

function Login(){
    function Validate(){

    }

     // Example starter JavaScript for disabling form submissions if there are invalid fields
(function () {
    'use strict'

    // Fetch all the forms we want to apply custom Bootstrap validation styles to
    var forms = document.querySelectorAll('.needs-validation')

    // Loop over them and prevent submission
    Array.prototype.slice.call(forms)
      .forEach(function (form) {
        form.addEventListener('submit', function (event) {
          if (!form.checkValidity()) {
            event.preventDefault()
            event.stopPropagation()
          }

          form.classList.add('was-validated')
        }, false)
      })
  })()


    return(
        <div className="container w-75 mt-5 bg-light rounder shadow">
            <div className="row align-items-stretch">
                <div className="col bg d-none d-lg-block col-md-5 col-lg-7 col-xl-6 rounder">

                </div>


                <div className="col p-5 rounder-end">
                    <div className="text-end">
                        <img src={logo} width="150"></img>
                    </div>
                    <h2 className="fw-bold text-center py-5">Bienvenido</h2>

                    <form>
                        <div className="mb-4">
                            <label for="email" className="form-label">Escribe Tu Correo</label>
                            <input type="text" className="form-control" placeholder="Email"></input>
                        </div>
                        <div className="mb-4">
                            <label for="password" className="form-label">Escribe Tu Constrase√±a</label>
                            <input type="password" className="form-control" placeholder="Password"></input>
                        </div>
                        <div className="my-3">
                        <span><a href="/Recover_pass">Forgot password?</a></span>
                        </div>
                        <div className="d-grid">
                            <button type="submit" className="btn btn-primary">Iniciar Sesion</button>
                        </div>

                        <div className="my-3">
                            <span className="fw-bold">No tienes Cuenta? <a href="/Sign_up">Create account</a></span>
                        </div>
                    </form>
                </div>
            </div>
        </div>
    );
}

export default Login;
